import React, { Component } from "react";
import "./index.css";
import ClipView from "./clip-cell";
export default class ClipsBar extends Component {
  constructor(props) {
    super(props);
    this.state = {
      data: [1, 2, 3, 4],
    };
  }
  render() {
    const { data } = this.state;
    return (
      <div style={{ backgroundColor: "#c51f5d", height: "100vh", borderRadius:'50px' }}>
        <section style={{ marginTop: "3vh" }}>
          <label style={{ fontSize: "70px", color: "#fff" }}>Clips</label>
        </section>
        <div className="video-container">
          {data.map((clip) => {
            return <ClipView />;
          })}
        </div>
      </div>
    );
  }
}
